import React from 'react';
import "./sidebar.css"
import { Link } from 'react-router-dom';

const Sidebar = ({ role, showSidebar, toggleSidebar }) => {
  const renderLinks = () => {
    switch (role) {
      case 'user':
        return (
          <>
            <Link to="/">Home</Link>
            {/* Add user-specific links */}
          </>
        );
      case 'admin':
        return (
          <>
            <Link to="/">Home</Link>
            {/* Add admin-specific links */}
          </>
        );
      case 'superadmin':
        return (
          <>
            <Link to="/">Home</Link>
            <Link to='/dashboards-a'>Dashboard</Link>
            <Link to='/create-admin'>Create Admin</Link>
            <Link to='/superadmin'>View Admin</Link>
            <Link to='/manage-users'>Manage users</Link>
          <Link to='/Complaint'>View Complaint</Link>
          </>
        );
      default:
        return null;
    }
  };

  return (
    <div className={`sidebar ${showSidebar ? 'open' : ''}`}>
      <button className="close-button" onClick={toggleSidebar}>{`close>`}</button>
      {renderLinks()}
    </div>
  );
};

export default Sidebar;
